import backgroundImageONE from "./background.png";
import backgroundImageTWO from "./background 2.png";

function backgroundImage() {
    return {backgroundImageONE};
};

function backgroundImage2() {
    return {backgroundImageTWO};
};

export default {backgroundImage, backgroundImage2};
